import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function RentPage() {
  const [form, setForm] = useState({
    rentRange: "",
    roomType: "",
    location: "",
    accommodationType: "",
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Preferences:", form);
    // Later: send this form data to backend & fetch results
    navigate("/landing-next"); // Example "results" page
  };

  // --- Styles ---
  const container = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    minHeight: "100vh",
    background: "linear-gradient(to right, #74ebd5, #ACB6E5)",
    fontFamily: "Arial, sans-serif",
  };

  const card = {
    width: "420px",
    background: "white",
    padding: "30px",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
  };

  const title = {
    textAlign: "center",
    marginBottom: "20px",
    color: "#333",
  };

  const input = {
    width: "100%",
    padding: "12px",
    margin: "10px 0",
    border: "1px solid #ccc",
    borderRadius: "8px",
    fontSize: "14px",
  };

  const button = {
    width: "100%",
    padding: "12px",
    marginTop: "15px",
    background: "#2575fc",
    border: "none",
    color: "white",
    borderRadius: "8px",
    cursor: "pointer",
    fontWeight: "bold",
    fontSize: "16px",
  };

  return (
    <div style={container}>
      <form style={card} onSubmit={handleSubmit}>
        <h2 style={title}>Find Your Accommodation</h2>

        <select
          name="rentRange"
          style={input}
          value={form.rentRange}
          onChange={handleChange}
          required
        >
          <option value="">Select Rent Range</option>
          <option value="Below 5k">Below ₹5000</option>
          <option value="5k-10k">₹5000 - ₹10000</option>
          <option value="10k-20k">₹10000 - ₹20000</option>
          <option value="Above 20k">Above ₹20000</option>
        </select>

        <select
          name="roomType"
          style={input}
          value={form.roomType}
          onChange={handleChange}
          required
        >
          <option value="">Select Room Type</option>
          <option value="Single">Single</option>
          <option value="Sharing">Sharing</option>
        </select>

        <input
          type="text"
          name="location"
          style={input}
          placeholder="Preferred Location"
          value={form.location}
          onChange={handleChange}
          required
        />

        <select
          name="accommodationType"
          style={input}
          value={form.accommodationType}
          onChange={handleChange}
          required
        >
          <option value="">Select Accommodation Type</option>
          <option value="PG">PG</option>
          <option value="Flat">Flat</option>
          <option value="Hostel">Hostel</option>
        </select>

        <button style={button} type="submit">
          Search Accommodation
        </button>
      </form>
    </div>
  );
}
